import "./loading.css"
import Logo from "../foto/fondos/logo_opt.jpg"
import videoCargando from "../foto/videos/videoCargando.mp4"
import ReactPlayer from "react-player"
function Cargando(){
    return(
       
      <div className="load">
         <ReactPlayer
          url={<iframe width="60" height="315" src="https://www.youtube.com/embed/pnpisvpSTUg" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>}
           playing width='120%' height='100%' controls
          />

        </div>
    )
}

export default Cargando
